import React, { useEffect } from "react"
import { Flex, Button, Text, Box, Image } from "rebass"
import { Input, Select } from "@rebass/forms"

const TabButton = props => (
	<Button
		variant="primary"
		width="1.34rem"
		height="0.38rem"
		bg="#000000"
		color="#ffffff"
		mt={"5.8%"}
		padding="0"
		sx={{
			borderRadius: 0,
			fontSize: "0.14rem",
			"&:hover": {
				background: "#FF8E6C"
			}
		}}
	>
		{props.text}
	</Button>
)

export default props => {
	return (
		<Flex
			alignItems="center"
			width="100%"
			height="80px"
			pl="24px"
			sx={{
				cursor: "pointer",
				"&:hover": {
					background: "rgba(255, 255, 255, 0.5)"
				}
			}}
		>
			<Input
				width="3rem"
				height="0.38rem"
				id="username"
				name="username"
				type="text"
				placeholder="STYLE NUMBER"
			/>
			<Flex>
				<Flex>
					<TabButton text="AREA" />
					<TabButton text="STYLE" />
					<TabButton text="AGE" />
				</Flex>
				<Flex border="1px soild #000">
					<Box>
						<Select></Select>
					</Box>
				</Flex>
			</Flex>
		</Flex>
	)
}
